import React, { Component } from 'react';
import './App.css';
import {data} from './searchData';
import SearchItem from './searchItem';

class SearchComponent extends Component {
    constructor() {
        super();
    };

    render () {
        const testData = {
            group: {
                displayName: 'group dis name'
            },
            item: {
                displayName: 'item dis name'
            }
        };
        return (
            <React.Fragment>
                {
                    data.groups.map(group => {
                        console.log(group)
                        group.items.map(item => {
                            console.log(item)
                            return (
                                <SearchItem props = {{group}} />
                            )
                        })
                    })

                }
                {/* <SearchItem props = {testData} /> */}
            </React.Fragment>
        )
    }
};

export default SearchComponent;
